import './App.css';
import { PrimaryButton, SecondaryButton } from './components/Button';
import Cards from './components/cards';
import { Input, PasswordInput } from './components/Input';

function App() {
  return (
    <div className="App">
      Hello
      <Cards>
        <h1>Whereas disregard and contempt for human rights have resulted</h1>
        <span>Whereas disregard and contempt for human rights have resulted</span>
        <p>Whereas disregard and contempt for human rights have resulted</p>
        <PrimaryButton label="Log in" />
        <SecondaryButton label='Sign Up' />
        <Input label="Email" placeholder="Please enter email" />
        <PasswordInput label="Password" placeholder="Please enter password"/>
      </Cards>
    </div>
  );
}

export default App;
